import './UserInfoPage.css'
import { UserOutlined, TransactionOutlined, SmileOutlined} from '@ant-design/icons';
import UserInfo from './UserInfo';
const {Content, Sider } = Layout;

function UserInfoPage(){
    return(
        <Layout>
            <Sider width={240} className="site-layout-background">
                <Menu
                mode="inline"
                defaultSelectedKeys={['1']}
                defaultOpenKeys={['sub1']}
                style={{ height: '100%', borderRight: 0 }}
                >
                    <Menu.Item key="1" icon={<UserOutlined />}>Basic Information</Menu.Item>
                    <Menu.Item key="2" icon={<SmileOutlined />}>Posted Animals</Menu.Item>
                    <Menu.Item key="3" icon={<TransactionOutlined />}>Transaction History</Menu.Item>
                </Menu>
            </Sider>
            <Layout style={{ padding: '0 24px 24px' }}>
                <Breadcrumb style={{ margin: '16px 0' }}>
                {/* <Breadcrumb.Item>Home</Breadcrumb.Item> */}
                </Breadcrumb>
                {/* <Content className="site-layout-background">
